import { Link, useNavigate } from "react-router-dom";

const Error = () => {
    const navigate =useNavigate();
    return ( 
<div>
    <div className=" justify-content-center align-items-center mt-5 pt-5 text-secondary ">
        <center className='pt-3 fs-1 '>Page Restricted</center>
        <center className='pt-4 fs-1 '>- or -</center>
        <center className='pt-4 fs-1 '>404</center>
        <center className='fs-1'>Page not found</center>
        <center className='pt-3 fs-3 text-primary text-decoration-underline' onClick={()=>navigate(-1)}>
            {/* <Link className='fs-3 pt-3' to={()=>navigate(-1)}></Link> */}
            <i className="bi bi-arrow-left fs-3"></i>  Go Back 
        </center>
        <center className='pt-3'><Link className='fs-3 pt-3' to='/'><i className="bi bi-arrow-left fs-3"></i>  Redirect back to home page </Link> </center>
        <center className='fs-4 text-secondary pt-3'>MediTech Private Ltd</center>
    </div>
</div>
     );
}

export default Error;
